import React from 'react';
import styled from 'styled-components';

import Link from '../../Link.js';
import EU from '../../../img/eu.svg';
import Glob from '../../../img/glob.svg';
import PCI from '../../../img/pci.svg';
import US from '../../../img/us.svg';
import Soc from '../../../img/soc.svg';
import About4 from './About4';





const Container = styled.div`
    width: 1903px;
    height: 400px;
    position: relative;
    top: 0px;

`
const InContainer = styled.div`
    width: 1040px;
    height: 400px;
    margin: 0 432px;
    padding: 0 20px;
    display: flex;



`

const Box = styled.div`
 position: relative;
 p{
    padding-bottom: 20px;

 }

 a{
    color: #6772e5;
    font-size: 15px;

 }

 ul{
    margin: 40px auto 0;
    display: grid;
    grid-template-columns: 1fr 1fr;
    max-width: 440px;
    list-style: none;
 }
 figure{
     width: 500px;
 }

  img{
      border-radius: 50%;

  }
`

const Item = styled.div`
    width: 500px;
    display: flex;
    a{  

        color: #6772e5;
        font-size: 19px;
    }
    p{
        font-size: 19px;
        font-weight: 300;
        margin: 0;
        border: none;
    }
    span{
        font-weight: 500;
    }
`


class About3 extends React.Component {
  render(){
    return (
        <Container>
            <InContainer>
                <Box >
                    <figure>
                    <ul>
                        <li>
                            <img src={PCI} alt="pci"/>
                            <p>PCI DSS Level 1 certification</p>
                        </li>
                        <li>
                        <img src={US} alt="US"/>
                        <p>Money Transmitter Licenses across the US</p>
                        </li>
                        <li>
                        <img src={EU} alt="eu"/>
                        <p><Link text="PSD2 and Strong Customer Authentication (SCA) compliant"></Link></p>
                        </li>
                        <li>
                        <img src={Soc} alt="Soc"/>
                        <p>SSAE18/SOC 1 type 1 and type 2 and SSAE18/SOC 2 type 1 reports</p>
                        </li>
                        <li>
                        <img src={Glob} alt="pci"/>
                        <p>AFSL in Australia, E-Money License in Europe, and registered MSB in Canada</p>
                        </li>
                    </ul>
                    </figure>

                </Box>
                <About4/>
            </InContainer>
        </Container>
    );
  }
}
export default About3;
